import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './index.css';

class Login extends Component {
	constructor(props) {
		super(props);

		this.state = {
			username: '',
			password: ''
		};
	}

	render() {
		return (
			<div>
				<div>
					<div id="title"><Link to="/">MATCH<span class="red">A</span></Link></div>
					<div className="login"></div>
				</div>
			</div>
		);
	}
}

export default Login;
